Test: Vertical Alignment

        /* Reset for consistency */
        * { margin: 0; padding: 0; box-sizing: border-box; }
        body { font-family: 'Arial', sans-serif; font-size: 16px; }

        /* Test container */
        .test-container {
            width: 700px;
            height: 600px;
            border: 2px solid #333;
            padding: 20px;
            background-color: #f9f9f9;
        }

        /* Test-specific CSS */
        .alignment-group {
            border: 1px dashed #999;
            margin: 20px 0;
            padding: 10px;
            background-color: white;
            height: 120px;
            line-height: 120px; /* For baseline demonstration */
        }

        .inline-element {
            display: inline-block;
            width: 80px;
            height: 60px;
            margin: 0 10px;
            border: 1px solid #666;
            text-align: center;
            line-height: 60px;
            font-size: 12px;
        }

        .baseline {
            vertical-align: baseline;
            background-color: #ffcccc;
        }

        .top {
            vertical-align: top;
            background-color: #ccffcc;
        }

        .middle {
            vertical-align: middle;
            background-color: #ccccff;
        }

        .bottom {
            vertical-align: bottom;
            background-color: #ffffcc;
        }

        .text-top {
            vertical-align: text-top;
            background-color: #ffccff;
        }

        .text-bottom {
            vertical-align: text-bottom;
            background-color: #ccffff;
        }

        .super {
            vertical-align: super;
            background-color: #ffaaaa;
            font-size: 10px;
        }

        .sub {
            vertical-align: sub;
            background-color: #aaffaa;
            font-size: 10px;
        }

        .percentage {
            vertical-align: 20%;
            background-color: #aaaaff;
        }

        .group-label {
            display: block;
            font-weight: bold;
            margin-bottom: 10px;
            line-height: normal;
        }





            Vertical-align values with inline-block elements:
            baseline
            top
            middle
            bottom



            Text-relative alignments:
            text-top
            text-bottom
            super
            sub



            Percentage alignment:
            20%
            baseline





